Templates.template:
new sap.ui.suite.TaskCircle({
	id: "${id}", // sap.ui.core.ID
	value: 0, // int
	maxValue: 100, // int
	minValue: 0, // int
	color: sap.ui.suite.TaskCircleColor.Gray, // sap.ui.suite.TaskCircleColor
	ariaLabelledBy: [], // sap.ui.core.Control
	ariaDescribedBy: [], // sap.ui.core.Control
	press: [function (oEvent) {
		var control = oEvent.getSource();
	}, this]
})

new sap.ui.suite.VerticalProgressIndicator({
	id: "${id}", // sap.ui.core.ID
	percentage: undefined, // int
	ariaLabelledBy: [], // sap.ui.core.Control
	ariaDescribedBy: [], // sap.ui.core.Control
	press: [function (oEvent) {
		var control = oEvent.getSource();
	}, this]
})
